b = Game().board
cases = {(0, 0): [(0, 0), (0, 1), (0, 2), (1, 1), (1, 2), (1, 3)], (2, 3):
    [(2, 6), (2, 7), (2, 8), (3, 6), (3, 7), (3, 8)], (4, 2): [(4, 5), (4, 
    6), (4, 7), (5, 4), (5, 5), (5, 6)]}
for key in cases:
    tile = b.tiles[key[0]][key[1]]
    answers = cases[key]
    for ans in answers:
        point = b.points[ans[0]][ans[1]]
        assert point in tile.points
